root.render(
  <React.StrictMode>
    <BrowserRouter>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<AddVendor/>}/>
        <Route path="/vendor/:id" element={<Vendor/>}/>
        <Route path="/vendors" element={<Vendors/>}/>
      </Routes>
    </BrowserRouter>  
